* Please vote on this issue by adding a üëç [reaction](https://blog.github.com/2016-03-10-add-reactions-to-pull-requests-issues-and-comments/) to the original issue to help the community and maintainers prioritize this request
* Please do not leave "+1" or other comments that do not add relevant new information or questions, they generate extra noise for issue followers and do not help prioritize the request
* If you are interested in working on this issue or have submitted a pull request, please leave a comment

### Description

With the introduction of Lambda function URLs using AWS_IAM as auth type, we will need the ability to attach a resource based policy to the lambda function. When doing it via the console the resulting policy statement looks like this

```json
    {
      "Sid": "AllowEngineeringUsers",
      "Effect": "Allow",
      "Principal": {
        "AWS": "arn:aws:iam::XXXXXXXXXXX:root"
      },
      "Action": "lambda:InvokeFunctionUrl",
      "Resource": "arn:aws:lambda:us-east-2:XXXXXXXXXX:function:create_new_subgroup",
      "Condition": {
        "StringEquals": {
          "lambda:FunctionUrlAuthType": "AWS_IAM"
        }
      }
    }
   
```

When trying to do it via the `aws_lambda_permission` resource type the resulting policy looks like this

```json
 {
      "Sid": "AllowEngineeringUsers",
      "Effect": "Allow",
      "Principal": {
        "AWS": "arn:aws:iam::XXXXXXXXXX:root"
      },
      "Action": "lambda:InvokeFunctionUrl",
      "Resource": "arn:aws:lambda:us-east-2:XXXXXXXXXX:function:create_new_subgroup"
    }
```

While the latter policy still works, it would be nice to have the addition of the conditional so we can match the console output.

### New or Affected Resource(s)

