{'action': 'created', 'issue': {'url': 'https://api.github.com/repos/awslabs/aws-lambda-rust-runtime/issues/452', 'repository_url': 'https://api.github.com/repos/awslabs/aws-lambda-rust-runtime', 'labels_url': 'https://api.github.com/repos/awslabs/aws-lambda-rust-runtime/issues/452/labels{/name}', 'comments_url': 'https://api.github.com/repos/awslabs/aws-lambda-rust-runtime/issues/452/comments', 'events_url': 'https://api.github.com/repos/awslabs/aws-lambda-rust-runtime/issues/452/events', 'html_url': 'https://github.com/awslabs/aws-lambda-rust-runtime/issues/452', 'id': 1175308289, 'node_id': 'I_kwDOCVfZHs5GDcgB', 'number': 452, 'title': 'Allow customized User-Agent used by lambda-runtime-api-client', 'user': {'login': 'bnusunny', 'id': 12918, 'node_id': 'MDQ6VXNlcjEyOTE4', 'avatar_url': 'https://avatars.githubusercontent.com/u/12918?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/bnusunny', 'html_url': 'https://github.com/bnusunny', 'followers_url': 'https://api.github.com/users/bnusunny/followers', 'following_url': 'https://api.github.com/users/bnusunny/following{/other_user}', 'gists_url': 'https://api.github.com/users/bnusunny/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/bnusunny/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/bnusunny/subscriptions', 'organizations_url': 'https://api.github.com/users/bnusunny/orgs', 'repos_url': 'https://api.github.com/users/bnusunny/repos', 'events_url': 'https://api.github.com/users/bnusunny/events{/privacy}', 'received_events_url': 'https://api.github.com/users/bnusunny/received_events', 'type': 'User', 'site_admin': False}, 'labels': [], 'state': 'open', 'locked': False, 'assignee': None, 'assignees': [], 'milestone': None, 'comments': 2, 'created_at': '2022-03-21T12:24:58Z', 'updated_at': '2022-03-22T02:19:49Z', 'closed_at': None, 'author_association': 'CONTRIBUTOR', 'active_lock_reason': None, 'body': 'In [AWS Lambda Adapter](https://github.com/aws-samples/aws-lambda-adapter), we want to send a custom User_Agent to lambda Runtime API. 

lambda-runtime-api-client has a default User-Agent string, e.g. "aws-lambda-rust/0.5.0". To allow custom User_Agent, we can set an environment variable CUSTOM_USER_AGENT at compiling time, like this. 
```rust
const CUSTOM_USER_AGENT: Option<&str> = option_env!("CUSTOM_USER_AGENT");
```
And when building the http request, use its value if it is configured, otherwise send the default User_Agent. e.g.

```rust
pub fn build_request() -> http::request::Builder {
    let user_agent = match CUSTOM_USER_AGENT {
        Some(value) => value,
        None => USER_AGENT,
    };
    http::Request::builder().header(USER_AGENT_HEADER, user_agent)
}
```

@calavera @nmoutschen What's your opinion? 
