{'action': 'created', 'issue': {'url': 'https://api.github.com/repos/aws-samples/aws-lambda-adapter/issues/18', 'repository_url': 'https://api.github.com/repos/aws-samples/aws-lambda-adapter', 'labels_url': 'https://api.github.com/repos/aws-samples/aws-lambda-adapter/issues/18/labels{/name}', 'comments_url': 'https://api.github.com/repos/aws-samples/aws-lambda-adapter/issues/18/comments', 'events_url': 'https://api.github.com/repos/aws-samples/aws-lambda-adapter/issues/18/events', 'html_url': 'https://github.com/aws-samples/aws-lambda-adapter/issues/18', 'id': 1129361223, 'node_id': 'I_kwDOF7ZNpM5DUK9H', 'number': 18, 'title': 'How does the `lambda-adapter` binary get executed?', 'user': {'login': 'peabnuts123', 'id': 2322840, 'node_id': 'MDQ6VXNlcjIzMjI4NDA=', 'avatar_url': 'https://avatars.githubusercontent.com/u/2322840?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/peabnuts123', 'html_url': 'https://github.com/peabnuts123', 'followers_url': 'https://api.github.com/users/peabnuts123/followers', 'following_url': 'https://api.github.com/users/peabnuts123/following{/other_user}', 'gists_url': 'https://api.github.com/users/peabnuts123/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/peabnuts123/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/peabnuts123/subscriptions', 'organizations_url': 'https://api.github.com/users/peabnuts123/orgs', 'repos_url': 'https://api.github.com/users/peabnuts123/repos', 'events_url': 'https://api.github.com/users/peabnuts123/events{/privacy}', 'received_events_url': 'https://api.github.com/users/peabnuts123/received_events', 'type': 'User', 'site_admin': False}, 'labels': [], 'state': 'open', 'locked': False, 'assignee': None, 'assignees': [], 'milestone': None, 'comments': 2, 'created_at': '2022-02-10T02:41:25Z', 'updated_at': '2022-02-10T03:12:40Z', 'closed_at': None, 'author_association': 'NONE', 'active_lock_reason': None, 'body': 'Hi, probably a bit of a random question, but I'm just learning about how Lambda and how this `lambda-adapter` works. I understand how one can define and use a wrapper script (i.e. `AWS_LAMBDA_EXEC_WRAPPER`) or a [custom runtime](https://docs.aws.amazon.com/lambda/latest/dg/runtimes-custom.html) to inject and modify how a Lambda function executes. But after studying [one of the examples](https://github.com/aws-samples/aws-lambda-adapter/tree/main/examples/expressjs-zip) for a long time, I can't figure out how the `/opt/extensions/lambda-adapter` binary should get invoked.

As far as I can tell. The `nodejs14.x` runtime will invoke the wrapper script `/opt/bootstrap`, which will replace the last argument with `"${LAMBDA_TASK_ROOT}/${_HANDLER}"` i.e. probably something like `/var/task/app.js`. This immediately takes the `node.js` runtime into the application's code (i.e. a simple express server) which doesn't leave any room for the `lambda-adapter` binary to be invoked.

The only thing I can think of is that the name `/opt/extensions/lambda-adapter` is a special path that the code within the `nodejs14.x` runtime knows to run. Is that the case? Or is there more setup missing here? ', 'reactions': {'url': 'https://api.github.com/repos/aws-samples/aws-lambda-adapter/issues/18/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'timeline_url': 'https://api.github.com/repos/aws-samples/aws-lambda-adapter/issues/18/timeline', 'performed_via_github_app': None}, 'comment': {'url': 'https://api.github.com/repos/aws-samples/aws-lambda-adapter/issues/comments/1034447949', 'html_url': 'https://github.com/aws-samples/aws-lambda-adapter/issues/18#issuecomment-1034447949', 'issue_url': 'https://api.github.com/repos/aws-samples/aws-lambda-adapter/issues/18', 'id': 1034447949, 'node_id': 'IC_kwDOF7ZNpM49qGxN', 'user': {'login': 'bnusunny', 'id': 12918, 'node_id': 'MDQ6VXNlcjEyOTE4', 'avatar_url': 'https://avatars.githubusercontent.com/u/12918?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/bnusunny', 'html_url': 'https://github.com/bnusunny', 'followers_url': 'https://api.github.com/users/bnusunny/followers', 'following_url': 'https://api.github.com/users/bnusunny/following{/other_user}', 'gists_url': 'https://api.github.com/users/bnusunny/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/bnusunny/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/bnusunny/subscriptions', 'organizations_url': 'https://api.github.com/users/bnusunny/orgs', 'repos_url': 'https://api.github.com/users/bnusunny/repos', 'events_url': 'https://api.github.com/users/bnusunny/events{/privacy}', 'received_events_url': 'https://api.github.com/users/bnusunny/received_events', 'type': 'User', 'site_admin': False}, 'created_at': '2022-02-10T03:12:40Z', 'updated_at': '2022-02-10T03:12:40Z', 'author_association': 'CONTRIBUTOR', 'body': 'Correct. The wrapper script starts an express.js server and replaces the runtime process. Lambda Adapter is the proxy between Lambda runtime API and the express.js server. Adapter translates lambda events (json payload) into http requests, send them to the express.js server. When the express.js server send http response, lambda adapter converts it into the json response format and send it back to lambda runtime API. ', 'reactions': {'url': 'https://api.github.com/repos/aws-samples/aws-lambda-adapter/issues/comments/1034447949/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'performed_via_github_app': None}}

